Insert into T_MC_PRODUTO (CD_PRODUTO,CD_CATEGORIA,NR_CD_BARRAS_PROD,DS_PRODUTO,VL_UNITARIO,TP_EMBALAGEM,ST_PRODUTO,VL_PERC_LUCRO,DS_COMPLETA_PROD) values ('15','8',null,'	The Last of Us Part II - PlayStation 4	','129,9',null,'A','15','Cinco anos depois da jornada perigosa pelos Estados Unidos pós-pandêmicos, Ellie e Joel se estabelecem em Jackson, Wyoming. A vida em uma próspera comunidade de sobreviventes lhes trouxe paz e estabilidade, apesar da ameaça constante dos infectados e de outros sobreviventes mais desesperados. Quando um evento violento interrompe essa paz, Ellie embarca em uma jornada implacável para fazer justiça e encontrar uma solução. Enquanto vai atrás de cada um dos responsáveis, ela se confronta com as repercussões físicas e emocionais devastadoras de suas ações. Uma história complexa e emocionante Vivencie os conflitos morais cada vez maiores criados pela busca implacável de Ellie por vingança. O ciclo de violência deixado em seu caminho desafiará suas noções de certo ou errado, bem ou mal e herói ou vilão. Um mundo belo, mas perigoso Embarque na jornada de Ellie, levando-a das montanhas e florestas tranquilas de Jackson até as ruínas exuberantes e cobertas pela vegetação da área metropolitana de Seattle. Encontre novos grupos de sobreviventes, ambientes desconhecidos e traiçoeiros e evoluções terríveis dos infectados. Criados pela versão mais recente do mecanismo da Naughty Dog, o mundo e os personagens mortais estão mais realistas e meticulosamente detalhados do que nunca. Partida tensa e alucinante de ação e sobrevivência Os sistemas de partida novos e avançados atendem aos desafios de vida ou morte da jornada de Ellie por um mundo hostil. Vivencie sua batalha alucinante pela sobrevivência através de recursos aprimorados como combate corpo a corpo de alta intensidade, movimento fluido e ações furtivas dinâmicas. Uma ampla variedade de armas, itens de criação, habilidades e atualizações possibilitam que você personalize as habilidades de Ellie de acordo com seu estilo de jogo.--Idioma ? : ? Português-Dimensões do produto ? : ? 13.5 x 3 x 19 cm; 200 g-Número do modelo ? : ? P4MA00736702FGM-Data de lançamento ? : ? 19 junho 2020-ASIN ? : ? B07ZGFHZVZ-País de origem ? : ? Brasil--');
